import React from 'react';
import './AddUser.css';

const AddUser = () => {
  return (
    <div className='input'>
      <label className='label'>이름</label>
      <input type='text' className='input' />
      <label className='label'>나이</label>
      <input type='text' className='input' />
    </div>
  );
};

export default AddUser;
